// Main React App component
import React, { useContext } from 'react';
import { BrowserRouter as Router, Routes, Route, useParams, useNavigate } from 'react-router-dom';
import Hub from './components/Hub/Hub';
import TourEditor from './components/Editor/TourEditor';
import EmbedPage from './pages/EmbedPage';
import LandingMap from './components/LandingMap';
import TourViewer from './components/Viewer/TourViewer';
import LandingPage from './pages/LandingPage';
import Shop from './components/Shop/Shop';
import Login from './components/Auth/Login';
import Register from './components/Auth/Register';
import { UserProvider, UserContext } from './context/UserContext';
import UserCircle from './components/UserCircle';
import './App.css';

function TourEditorWrapper() {
  const { tourId } = useParams();
  return <TourEditor tourId={tourId} />;
}

function ShopWrapper() {
  const { tourId } = useParams();
  return <Shop tourId={tourId} />;
}

function Navbar() {
  const { user } = useContext(UserContext);
  const navigate = useNavigate();
  const hideNavbar = window.location.pathname.startsWith('/map')
    || window.location.pathname.startsWith('/viewer')
    || window.location.pathname.startsWith('/embed');
  if (hideNavbar) return null;
  return (
    <nav style={{
      width: '100%',
      background: '#23272f',
      color: '#38bdf8',
      padding: '12px 32px',
      display: 'flex',
      alignItems: 'center',
      justifyContent: 'space-between',
      position: 'fixed',
      top: 0,
      left: 0,
      zIndex: 1000,
      boxShadow: '0 2px 12px rgba(56,189,248,0.07)'
    }}>
      <div style={{ fontWeight: 700, fontSize: '1.18rem', letterSpacing: '1px', cursor: 'pointer' }} onClick={() => navigate('/')}>
        Tours 360° Manager
      </div>
      <div>
        {!user ? (
          <button
            style={{
              background: '#38bdf8',
              color: '#181c23',
              border: 'none',
              borderRadius: 8,
              padding: '8px 18px',
              fontSize: '1rem',
              fontWeight: 600,
              cursor: 'pointer',
              transition: 'background 0.2s, color 0.2s'
            }}
            onClick={() => navigate('/login')}
          >
            Login
          </button>
        ) : (
          <UserCircle />
        )}
      </div>
    </nav>
  );
}

function LayoutWithUser({ children }) {
  const hideUserCircle = window.location.pathname.startsWith('/map')
    || window.location.pathname.startsWith('/viewer')
    || window.location.pathname.startsWith('/embed');
  return (
    <div>
      <Navbar />
      {/* El círculo de usuario ya está en el navbar */}
      <div style={{ paddingTop: hideUserCircle ? 0 : 62 }}>
        {children}
      </div>
    </div>
  );
}

function App() {
  return (
    <UserProvider>
      <Router>
        <LayoutWithUser>
          <Routes>
            <Route path="/login" element={<Login />} />
            <Route path="/register" element={<Register />} />
            <Route path="/" element={<LandingPage />} />
            <Route path="/map" element={<LandingMap />} />
            <Route path="/hub" element={<Hub />} />
            <Route path="/editor/:tourId" element={<TourEditorWrapper />} />
            <Route path="/viewer/:tourId" element={<TourViewer />} />
            <Route path="/embed/:apiKey" element={<EmbedPage />} />
            <Route path="/shop" element={<Shop />} />
            <Route path="/shop/:tourId" element={<ShopWrapper />} />
          </Routes>
        </LayoutWithUser>
      </Router>
    </UserProvider>
  );
}

export default App;
